import styled from 'styled-components';

export const VideoContainer = styled.div`
	background-color: ${(props) => props.theme.OffWhite};
	width: 100%;
	height: 100%;
	border-radius: 0.7rem;
	display: flex;
	align-items: center;
	justify-content: center;
`;
